import { Routes } from '@angular/router';

export const routes: Routes = [
  {
    path: '',
    pathMatch: 'full',
    redirectTo: 'home'
  },

  {
    path: 'home',
    loadComponent: () => import('./pages/home/home')
  },

  {
    path: 'cars',
    loadComponent: () => import('./pages/cars/cars')
  },

  {
    path: 'bikes',
    loadComponent: () => import('./pages/bikes/bikes')
  },

];
